const StudentList = (props) => {
    
    return (
        <ul>
            <li>{props.students[0].name}</li>
            <li>{props.students[1].name}</li>
            <li>{props.students[2].name}</li>
            <li>{props.students[3].name}</li>
        </ul>
    )
}

export default StudentList
